import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import { supabase } from '../../services/supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import { Line } from 'react-chartjs-2';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const Dashboard = () => {
  const { user } = useAuth();
  const [conversations, setConversations] = useState([]);
  const [upcomingSession, setUpcomingSession] = useState(null);
  const [sentimentData, setSentimentData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Fetch recent conversations
        const { data: conversationsData, error: conversationsError } = await supabase
          .from('conversations')
          .select('*, summaries(*)')
          .eq('client_id', user.id)
          .order('start_ts', { ascending: false })
          .limit(5);

        if (conversationsError) throw conversationsError;

        // Fetch upcoming session
        const { data: sessionData, error: sessionError } = await supabase
          .from('sessions')
          .select('*, therapists(*)')
          .eq('client_id', user.id)
          .gt('start_time', new Date().toISOString())
          .order('start_time', { ascending: true })
          .limit(1)
          .single();

        if (sessionError && sessionError.code !== 'PGRST116') {
          // PGRST116 means no rows returned, which is fine
          throw sessionError;
        }

        // Fetch sentiment data for chart
        const { data: sentimentData, error: sentimentError } = await supabase
          .from('messages')
          .select('timestamp, sentiment_score')
          .eq('conversation_id', conversationsData?.[0]?.id)
          .order('timestamp', { ascending: true });

        if (sentimentError) throw sentimentError;

        setConversations(conversationsData || []);
        setUpcomingSession(sessionData || null);

        // Process sentiment data for chart
        if (sentimentData) {
          const chartData = {
            labels: sentimentData.map(d => new Date(d.timestamp).toLocaleDateString()),
            datasets: [
              {
                label: 'Sentiment Score',
                data: sentimentData.map(d => d.sentiment_score),
                borderColor: 'rgb(75, 192, 192)',
                tension: 0.1
              }
            ]
          };
          setSentimentData(chartData);
        }
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, [user.id]);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-full">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow p-6">
        <h1 className="text-2xl font-semibold text-secondary-900">
          Welcome back, {user.profile_data?.name || 'Client'}
        </h1>
        <p className="mt-2 text-secondary-600">
          Track your progress and manage your therapy sessions here.
        </p>
      </div>

      {/* Quick Actions */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <Link
          to="/client/chat"
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow"
        >
          <h2 className="text-lg font-medium text-secondary-900">Start Chat Session</h2>
          <p className="mt-2 text-secondary-600">
            Connect with your AI therapist now
          </p>
        </Link>

        <button
          onClick={() => {/* Schedule session logic */}}
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow text-left"
        >
          <h2 className="text-lg font-medium text-secondary-900">Schedule Session</h2>
          <p className="mt-2 text-secondary-600">
            Book a session with your therapist
          </p>
        </button>

        <button
          onClick={() => {/* View resources logic */}}
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow text-left"
        >
          <h2 className="text-lg font-medium text-secondary-900">Resources</h2>
          <p className="mt-2 text-secondary-600">
            Access helpful materials and exercises
          </p>
        </button>
      </div>

      {/* Upcoming Session */}
      {upcomingSession && (
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-medium text-secondary-900">Upcoming Session</h2>
          <div className="mt-4">
            <p className="text-secondary-600">
              With Dr. {upcomingSession.therapists.name}
            </p>
            <p className="text-secondary-900 font-medium">
              {new Date(upcomingSession.start_time).toLocaleString()}
            </p>
            <button
              onClick={() => {/* Join session logic */}}
              className="mt-4 bg-primary-500 text-white px-4 py-2 rounded-lg hover:bg-primary-600"
            >
              Join Session
            </button>
          </div>
        </div>
      )}

      {/* Progress Chart */}
      {sentimentData && (
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-medium text-secondary-900 mb-4">Your Progress</h2>
          <div className="h-64">
            <Line
              data={sentimentData}
              options={{
                responsive: true,
                maintainAspectRatio: false,
                scales: {
                  y: {
                    beginAtZero: true,
                    max: 1
                  }
                }
              }}
            />
          </div>
        </div>
      )}

      {/* Recent Conversations */}
      <div className="bg-white rounded-lg shadow p-6">
        <h2 className="text-lg font-medium text-secondary-900 mb-4">Recent Sessions</h2>
        <div className="space-y-4">
          {conversations.map((conversation) => (
            <div
              key={conversation.id}
              className="border-b border-secondary-200 last:border-0 pb-4 last:pb-0"
            >
              <div className="flex justify-between items-start">
                <div>
                  <p className="text-secondary-900 font-medium">
                    {new Date(conversation.start_ts).toLocaleDateString()}
                  </p>
                  <p className="text-secondary-600 text-sm mt-1">
                    {conversation.summaries?.[0]?.summary_text || 'No summary available'}
                  </p>
                </div>
                <button
                  onClick={() => {/* View details logic */}}
                  className="text-primary-600 hover:text-primary-700 text-sm font-medium"
                >
                  View Details
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
